import React from "react"

var year = new Date.getFullYear();


function Footer() {
    return (
    <footer class="text-muted">
    <div class="container">
      <p class="float-right">
        <a href="#">Back to top</a>
      </p>
      <p>Copyright {year}</p>
    </div>
  </footer>
    )
  }

  export default Footer;
